  input: 'TEXT,F3A,,"In response to the inquiry regarding the election cycle for this
    report, it is correct and reflects the dates 11/6/02-11/2/04. In response to the
    inquiry for the debt payments for this period for Bob Beckel and Cather Publishing,
    there were no payments made to these entities during the coverage period for this
    report. After investigation, it was found that the Cather Publishing debt was
    paid in full and a letter was received by our office from Cather Publishing stating
    such. This letter will be sent to the FEC for recordkeeping. The same for Bob
    Beckel and Associates debt. In response to the inquiry regarding the closing and
    opening balances for several debts: Bob Beckel and Associates, the balance is
    identical to the one on the previous report; Cather Publishing, the balance is
    identical to the one on the previous report; Wiley Graphics, there is a $0 balance
    because payment was made during the coverage period and payment of debt was reflected
    in the Disbursements section of this report.  There was not a $1000 closing balance
    as listed in the inquiry letter. "'
